description:
Verenigde Staten / Canada
Horror / Thriller
99 minuten

goed

met Katee Sackhoff, Nathan Fillion en Teryl Rothery

In dit vervolg, volgen we een man wiens familie is vermoord en die zelf nipt aan de dood is ontsnapt. Vanaf dat moment kan hij 
aan mensen zien dat ze snel zullen sterven. Als hij ze vervolgens van dit noodlot wil redden, ontdekt hij de hoge prijs die hij 
moet betalen als je je bemoeit met de natuurlijke gang tussen leven en dood.
